Since WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Привіт!

Починаючи з версії 5.2 WordPress може визначати виникаючі помилки з плагінами або темою на сайті і надсилати вам таке повідомлення автоматично.
###CAUSE###
Спочатку зайдіть на ваш сайт (###SITEURL###) і перевірте всі видимі проблеми. Далі, зайдіть на сторінку, на якій виникла помилка (###PAGEURL###) і перевірте видимі проблеми на ній.

###SUPPORT###

Якщо ваш сайт зламаний і ви не зможете нормально увійти в майстерню, тепер можна використовувати спеціальний "режим відновлення", який дозволить безпечно увійти в майстерню для подальших дій.

###LINK###

З метою безпеки дія цього посилання закінчується через ###EXPIRES###. Але не турбуйтеся, якщо помилка виникне знову після закінчення цього часу, то вам буде надіслано нове посилання.

Для вирішення проблеми вам буде потрібна наступна інформація:

