ntly browsing the %1$s blog archives for the day %2$s.'=>'Наразі ви переглядаєте архіви блогу %1$s за %2$s.','You are currently browsing the archives for the %s category.'=>'Ви зараз переглядаєте архів категорії %s','Please include a %s template in your theme.'=>'Будь ласка, включіть у свою тему шаблон %s.','Theme without %s'=>'Тема без %s','Search or use up and down arrow keys to select an item.'=>'Скористайтеся пошуком або клавішами вгору/вниз, щоб вибрати елемент.','No search term specified. Showing recent items.'=>'Пошуковий запит не вказано. Відображено недавні елементи','Or link to existing content'=>'Або прив’язати до існуючого вмісту','Enter the destination URL'=>'Введіть URL призначення','Y/m/d'=>'d.m.Y','The next group of formatting shortcuts are applied as you type or when you insert them around plain text in the same paragraph. Press Escape or the Undo button to undo.'=>'Наступна група скорочень форматування застосовується коли ви друкуєте чи коли ви ставите їх навколо простого тексту в тому самому параграфі. Натисніть клавішу Escape або кнопку Скасувати, щоби скасувати.','The following formatting shortcuts are replaced when pressing Enter. Press Escape or the Undo button to undo.'=>'Наступні скорочення форматування замінені при натисканні клавіші "Enter". Натисніть клавішу "Escape", або кнопку "Скасувати", щоби скасувати.','When starting a new paragraph with one of these formatting shortcuts followed by a space, the formatting will be applied automatically. Press Backspace or Escape to undo.'=>'Коли новий параграф починається одним із цих скорочень форматування та пробілом, форматування застосується автоматично. Натисніть "Backspace", або "Escape", щоби скасувати.','To move focus to other buttons use Tab or the arrow keys. To return focus to the editor press Escape or use one of the buttons.'=>'Щоб перемістити фокус до інших кнопок, використовуйте Tab або клавіші зі стрілками. Щоб повернути фокус до редактора, натисніть Esc або використайте одну з кнопо