лений, або хтось видалив %s. Зараз Вам дійсно потрібно перевірити базу даних.','If you are the owner of this network please check that MySQL is running properly and all tables are error free.'=>'Якщо ви адміністратор мережі &#8212; переконайтеся, що MySQL працює і в таблицях немає помилок.','If your site does not display, please contact the owner of this network.'=>'Якщо ваш сайт не відображається, зверніться до адміністратора цієї мережі.','This site has been archived or suspended.'=>'Цей сайт заархівовано або призупинено.','This site has not been activated yet. If you are having problems activating your site, please contact %s.'=>'Цей сайт ще не активовано. Якщо у вас виникли проблеми при активації свого сайту, будь ласка, зв’яжіться з адміністратором: %s.','This site is no longer available.'=>'Даний сайт не доступний.','https://codex.wordpress.org/Function_Reference/is_main_query'=>'https://codex.wordpress.org/Function_Reference/is_main_query','In %1$s, use the %2$s method, not the %3$s function. See %4$s.'=>'У %1$s використовуйте метод %2$s, а не функцію %3$s. Див. %4$s.','Conditional query tags do not work before the query is run. Before then, they always return false.'=>'Умовні теґи запитів не працюють до здійснення запиту. До того, вони завжди повертають "false".','Invalid object ID.'=>'Невірний ID об\'єкта','%s: %l.'=>'%s: %l.','Could not split shared term.'=>'Не вийшло розділити спільну групу.','The slug &#8220;%s&#8221; is already in use by another term.'=>'Ярлик &#8220;%s&#8221; вже використовується іншим елементом','Could not insert term relationship into the database.'=>'Не вдалося вставити зв\'язок елемента в базу даних.','Could not insert term taxonomy into the database.'=>'Не вдалося вставити елемент таксономії в базу даних.','Could not insert term into the database.'=>'Не вдалося вставити елемент в базу даних','A term with the name provided already exists in this taxonomy.'=>'Термін з цією назвою та адресою вже існує в цій таксономії.','A term with 