чуванням','The URL to the admin area'=>'URL адміністративної частини','Login Address (URL)'=>'Адреса входу (URL)','Site Address (URL)'=>'Адреса сайту (URL)','WordPress Address (URL)'=>'Адреса WordPress (URL)','Software Version'=>'Версія платформи','Software Name'=>'Назва платформи','Incorrect username or password.'=>'Неправильне ім’я користувача чи пароль.','XML-RPC services are disabled on this site.'=>'Сервіс XML-RPC відключений на цьому сайті.','Block pattern descriptionThree small columns of text, each with an outlined button with rounded corners at the bottom.'=>'Три невеликих колонки тексту, кожна з контурною кнопкою з округленими кутами внизу.','Chapter Three'=>'Розділ третій','Wherein is related the droll way in which Don Quixote had himself dubbed a knight.'=>'Тут розповідається про те, як кумедно Дон Кіхот сам охрестив себе лицарем.','Chapter Two'=>'Розділ другий','Which treats of the first sally the ingenious Don Quixote made from home.'=>'Яка розповідає про першу вилазку з дому винахідливого Дон Кіхота.','Chapter One'=>'Розділ перший','Which treats of the character and pursuits of the famous Don Quixote of La Mancha.'=>'В якій розповідається про характер і заняттях знаменитого Дон Кіхота Ламанчського.','Three columns of text with buttons'=>'Текст в три стовпці з кнопками','Block pattern descriptionA quote and citation with an image above, and a separator at the bottom.'=>'Цитата з зображенням зверху, роздільник знизу.','— Don Quixote'=>'— Дон Кіхот','"Do you see over yonder, friend Sancho, thirty or forty hulking giants? I intend to do battle with them and slay them."'=>'"Бачиш он там, друже Санчо, тридцять або сорок незграбних велетнів? Я маю намір битися з ними і вбити їх."','Pencil drawing of Don Quixote'=>'Малюнок олівцем Дон Кіхота','Quote'=>'Цитата','Block pattern descriptionThree filled buttons with rounded corners, side by side.'=>'Три заповнених кнопки з округленими кутами, пліч-о-пліч.','Books'=>'Книги','Contact us'=>'Зв\'яжіться з нами','Three buttons'=>'Три кнопки','Block pattern descriptionA heading preceded by a chapter number, and followed by a paragraph.'=>'Заголовок з номером розділу перед ним і параграфом після.','These preliminaries settled, he did not care to put off any longer the execution of his design, urged on to it by the thought of all the world was losing by his delay, seeing what wrongs he intended to right, grievances to redress, injustices to repair, abuses to remove, and duties to discharge.'=>'Ці попередні приготування були улагоджені, він не хотів більше відкладати виконання свого задуму, спонукуваний до цього думкою про те, що весь світ втрачає через його зволікання, бачачи, які помилки, образи і несправедливості він має намір виправити, зловживання усунути і обов\'язки виконати.','Which treats of the first sally the ingenious Don Quixote made from home'=>'Яка розповідає про першу вилазку з дому винахідливого Дон Кіхота','Heading and paragraph'=>'Заголовок і параграф','Block pattern descriptionTwo columns of text, each with an image on top.'=>'Три колонки тексту, кожен з зображенням нагорі.','But of all there were none he liked so well as those of the famous Feliciano de Silva\'s composition, for their lucidity of style and complicated conceits were as pearls in his sight, particularly when in his reading he came upon courtships and cartels, where he often found passages like "the reason of the unreason with which my reason is afflicted so weakens my reason that with reason I murmur at your beauty;" or again, "the high heavens render you deserving of the desert your greatness deserves."'=>'Але жодне з них не подобалося йому так, як твори знаменитого Фелісіано де Сільви, бо їх ясність стилю і складне марнославство були перлинами в його очах, особливо коли в своєму читанні він натикався на залицяння і картелі, де він часто знаходив такі місця, як "причина нерозуміння, яким страждає мій розум, настільки послаблює мій розум, що я нарікаю на твою красу" або ще: "високі небеса роблять тебе гідним пустелі, на яку заслуговує твоя велич."','They must know, then, that the above-named gentleman whenever he was at leisure (which was mostly all the year round) gave himself up to reading books of chivalry with such ardour and avidity that he almost entirely neglected the pursuit of his field-sports, and even the management of his property; and to such a pitch did his eagerness and infatuation go that he sold many an acre of tillageland to buy books of chivalry to read, and brought home as many of them as he could get.'=>'Отже, ви повинні знати, що вищезгаданий ідальго щоразу, коли у нього був час для дозвілля (а в основному це був цілий рік), віддавався читанню лицарських книг з таким запалом і жадібністю, що майже повністю забував про свої спортивні заняття і навіть про управління своїм майном; і до такої міри його завзяття і пристрасть дійшли до того, що він продав багато акрів орної землі, щоб купити лицарські книги для читання, і приносив додому стільки книг, скільки міг дістати.','Two columns of text with images'=>'Текст в дві колонки з зображеннями','Block pattern descriptionTwo columns of text preceded by a long heading.'=>'Дві колонки тексту з довгим заголовком перед ними.','The rest of it went in a doublet of fine cloth and velvet breeches and shoes to match for holidays, while on week-days he made a brave figure in his best homespun. He had in his house a housekeeper past forty, a niece under twenty, and a lad for the field and market-place, who used to saddle the hack as well as handle the bill-hook. The age of this gentleman of ours was bordering on fifty; he was of a hardy habit, spare, gaunt-featured, a very early riser and a great sportsman.'=>'У святкові дні Дон Кехана одягав каптан з тонкого сукна, оксамитові штани і сап\'янові туфлі, а в будні носив костюм з грубого сукна домашньої роботи. У будинку у нього жила економка, якій перевалило за сорок років, племінниця, якій не було ще двадцяти, і старезний слуга. Самому ідальго було років під п\'ятдесят; він був худий, як скелет, - шкіра та кістки, але, незважаючи на жахливу худобу, відрізнявся великою витривалістю.','In a village of La Mancha, the name of which I have no desire to call to mind, there lived not long since one of those gentlemen that keep a lance in the lance-rack, an old buckler, a lean hack, and a greyhound for coursing. An olla of rather more beef than mutton, a salad on most nights, scraps on Saturdays, lentils on Fridays, and a pigeon or so extra on Sundays, made away with three-quarters of his income.'=>'В маленькому селі провінції Ламанчі жив ідальго, на ім\'я Дон Кехана. Як і всякий дворянин, він пишався своїм шляхетним походженням, свято беріг древній щит і родовий спис і тримав у себе на подвір\'ї худу шкапу і хорту собаку. Три чверті його доходів йшли на юшку з овочів з яловичиною та вінегрет, який йому подавали на вечерю; по п\'ятницях він постив, задовольняючись тарілкою вареної на воді сочевиці, проте по неділях ласував смаженим голубом.','Which treats of the character and pursuits of the famous gentleman Don Quixote of La Mancha'=>'В якій розповідається про характер і заняттях знаменитого Дон Кіхота Ламанчського.','Two columns of text'=>'Текст в дві колонки','Block pattern descriptionA large hero section with an example background image and a heading in the center.'=>'Великий розділ сюжету дня з фоновим зображенням прикладу і заголовком в центрі.','Don Quixote'=>'Дон Кіхот','Large header with a heading'=>'Великий заголовок','Block pattern descriptionTwo buttons, one filled and one outlined, side by side.'=>'Дві кнопки, заповнена і контурна, пліч-о-пліч.','About Cervantes'=>'Про Сервантес','Download now'=>'Завантажити','Two buttons'=>'Дві кнопки','An old pencil drawing of Don Quixote and Sancho Panza sitting on their horses, by Wilhelm Marstrand.'=>'Старовинний малюнок олівцем Дон Кіхота і Санчо Панси сидячих на конях. Вільгельм Марcтранд.','Block pattern descriptionAn image gallery with two example images.'=>'Галерея зображень з двома зображеннями для прикладу.','Two images side by side'=>'Два зображення в ряд','Block pattern descriptionA large hero section with a bright gradient background, a big heading and a filled button.'=>'Великий розділ сюжету дня з яскравим градієнтом фону, великий заголовок і кнопка з заповненням.','Read now'=>'Читати зараз','Thou hast seen<br>nothing yet'=>'Ви бачите,<br>що тут поки нічого немає','Write title…'=>'Введіть заголовок…','Large header with a heading and a button '=>'Великий заголовок з кнопкою','Whether theme opts in to default WordPress block styles for viewing.'=>'Підтримка темою стилів блоків WordPress за замовчуванням для перегляду.','Whether the theme can manage the document title tag.'=>'Підтримка темою властивості document title tag.','Whether the theme supports responsive embedded content.'=>'Підтримка темою адаптивного вбудованого вмісту.','The post types that support thumbnails or true if all post types are supported.'=>'Типи записів з підтримкою мініатюр або істина якщо підтримуються всі типи записів.','Post formats supported.'=>'Підтримувані формати запису.','Allows use of HTML5 markup for search forms, comment forms, comment lists, gallery, and caption.'=>'Дозволити використання html5 розмітки для форм пошуку і коментарів, списків коментарів, галереї та підпису.','Whether theme opts in to the editor styles CSS wrapper.'=>'Підтримка темою CSS стилів редактора.','Custom gradient presets if defined by the theme.'=>'Користувацькі градієнти за замовчуванням, якщо визначаються темою.','Custom font sizes if defined by the theme.'=>'Користувацькі шрифти, якщо визначаються темою.','Custom color palette if defined by the theme.'=>'Користувацька палітра кольорів, якщо визначається темою.','Whether the theme disables custom gradients.'=>'Відключення темою користувацьких градієнтів.','Whether the theme disables custom font sizes.'=>'Відключення темою користувацьких розмірів шрифтів.','Whether the theme disables custom colors.'=>'Відкл