е дії %2$s.','You need to pass an array of types.'=>'Ви маєте передати масив типів','You need to pass an array of post formats.'=>'Необхідно передати масив форматів записів.','Theme starter contentThis is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.'=>'Це приклад розділу домашньої сторінки. Розділи домашньої сторінки можуть бути будь-якими сторінками крім самої домашньої сторінки, включаючи сторінку останніх записів блогу.','Theme starter contentA homepage section'=>'Розділ домашньої сторінки','Theme starter contentNews'=>'Новини','Theme starter contentBlog'=>'Блог','Theme starter contentThis is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.'=>'Це сторінка з основною контактною інформацією, такою як адреса і номер телефону. Ви також можете спробувати додати форму контактів за допомогою плагіну.','Theme starter contentContact'=>'Контакти','Theme starter contentYou might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.'=>'Ви можете бути художником, який бажає тут представити себе і свої роботи або представником бізнесу з описом місії.','Theme starter contentAbout'=>'Про нас','Theme starter contentWelcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.'=>'Ласкаво просимо на ваш сайт! Це ваша домашня сторінка, яку більшість відвідувачів побачить зайшовши на ваш сайт в першого разу.','Theme starter contentYouTube'=>'YouTube','Theme starter contentYelp'=>'Yelp','Theme starter contentTwitter'=>'Twitter','Theme starter contentPinterest'=>'Pinterest','Theme starter contentLinkedIn'=>'LinkedIn','Theme starter contentInstagram'=>'Instagram','Theme starter contentGitHub'=>'GitHub','Theme starter contentFoursquare'=>'Fo